import React from "react";
import "./PartnershipTab.css";

const PartnershipTab = ({ partnerships }) => {
  const formatInning = (inningNum) => `Inning ${inningNum}`;

  return (
    <div className="partnership-container">
      {partnerships.map((inning, idx) => (
        <div key={idx}>
          <h3>{formatInning(inning.inning)}</h3>
          <table className="partnership-table">
            <thead>
              <tr>
                <th>Batting Pair</th>
                <th>Runs</th>
                <th>Balls</th>
                <th>Extras</th>
              </tr>
            </thead>
            <tbody>
              {inning.pairs.map((pair, index) => (
                <tr key={index}>
                  <td>{pair.striker} & {pair.nonStriker}</td>
                  <td>{pair.runs}</td>
                  <td>{pair.balls}</td>
                  <td>{pair.extras}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

export default PartnershipTab;
